package AdventOfCode

import (
	"fmt"
	"strings"
	"unicode"
)

const Day5Data = ""

func Main5() {
	startStr := Day5Data
	nextStr := DestroyAdj(Day5Data)
	toRemove := "abcdefghijklmnopqrstuvwxyz"
	ans := 10000
	for _, rmv := range toRemove {
		removedStr := RemoveUnit(startStr, string(rmv))
		removedNextStr := DestroyAdj(removedStr)
		for removedStr != removedNextStr {
			removedStr = removedNextStr
			removedNextStr = DestroyAdj(removedStr)
		}
		fmt.Println(len(removedStr), removedStr)
		ans = GetMin(ans, len(removedStr))
	}
	for startStr != nextStr {
		startStr = nextStr
		nextStr = DestroyAdj(startStr)
	}

}

func DestroyAdj(s string) string {
	var b strings.Builder
	for i := 0; i < len(s); {
		if i < len(s)-1 {
			first, second := rune(s[i]), rune(s[i+1])
			if (strings.ToLower(string(first)) == strings.ToLower(string(second))) && ((unicode.IsLower(first) && unicode.IsUpper(second)) || (unicode.IsLower(second) && unicode.IsUpper(first))) {
				i += 2
			} else {
				b.WriteRune(first)
				i += 1
			}
		} else {
			b.WriteRune(rune(s[i]))
			i += 1
		}
	}
	return b.String()
}

func RemoveUnit(s, unit string) string {
	var b strings.Builder
	for _, char := range s {
		if unicode.ToLower(rune(char)) == unicode.ToLower(rune(unit[0])) {
			continue
		}
		b.WriteRune(rune(char))
	}
	return b.String()
}
